import React, { useState } from "react";
import "./ExpenseItem.css";

const ExpenseItem = (props) => {
  const [title, setTitle] = useState(props.title);

  function clickHandle() {
    setTitle("Updated");
  }
  return (
    <div className="mb-4 mt-2">
      <div className="expenseItem m-2 rounded-pill ">
        <div className="ms-2 d-flex text-light">
          <div className="m-2 mt-3 me-5 date">August 20th 2022</div>
          <h2 className="me-auto mt-2">{props.title}</h2>
          <div className="py-2 px-3 price m-2 me-4 rounded fs-5 border border-white">
            {props.price}
          </div>
          <button className="p-0">Update</button>
        </div>
      </div>
    </div>
  );
};

export default ExpenseItem;
